import React from 'react';
import ReactDOM from 'react-dom/client';

import './index.css';
import Footer from './componsents/footer';

const App = () => {
  return (
    <div>
      <Footer />
    </div>
  );
};

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App />);
